import React from "react";
import {
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={400}
      naturalSlideHeight={500}
      totalSlides={3}
      className="row"
    >
      <div className="col s2 images-dots">
        <Dot className="images-dot" slide={0}>
          1
        </Dot>
        <Dot className="images-dot" slide={1}>
          2
        </Dot>
        <Dot className="images-dot" slide={2}>
          3
        </Dot>
      </div>
      <Slider className="col s10">
        <Slide index={0} className="aloo">
          <ImageWithZoom
            style={{ height: "550px" }}
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
          />
        </Slide>
        <Slide index={1}>
          <ImageWithZoom
            style={{ height: "550px" }}
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
          />
        </Slide>
        <Slide index={2}>
          <ImageWithZoom
            style={{ height: "550px" }}
            src="http://localhost:5000/uploads/2022-01-11T23:57:22.071Zc9f0f895fb98ab9159f51fd0297e236d2020112711493146905goqRXNpKFf.jpg"
          />
        </Slide>
      </Slider>
    </CarouselProvider>
  );
};

export default SlickCard;
